import Link from 'next/link';
import Layout from './Layout';

let channels = {
    ant1: "https://antennalivesp-lh.akamaihd.net/i/live_1@715138/index_800_av-p.m3u8",
    alpha: "https://alphalive-i.akamaihd.net/hls/live/682300/live/high/prog_index.m3u8",
    mega: "https://c98db5952cb54b358365984178fb898a.msvdn.net/live/S86713049/gonOwuUacAxM/playlist.m3u8",
    star: "https://cdnapisec.siliconweb.com/p/713821/sp/0/playManifest/entryId/1_fp7fyi3j/format/applehttp/protocol/https/flavorParamId/0/manifest.m3u8",
    skai: "https://youtu.be/CmqbY_Gzsdo",
    ert1: "https://ert-live.siliconweb.com/media/ert_1/ert_1medium.m3u8",
    ert2: "https://ert-live.siliconweb.com/media/ert_2/ert_2medium.m3u8",
    ertSports: "https://ert-live.siliconweb.com/media/ert_sports/ert_sportshigh.m3u8",
}

export default class Channels extends React.Component {

    render() {
        return (
            <Layout>     
                <div>
                    <Link href="/player"><button type="button" className="btn btn-outline-info" onClick={this.props.onCLick}>Ant1</button></Link>
                    <Link href="/player"><button type="button" className="btn btn-outline-info" onClick={this.props.onCLick}>Alpha</button></Link>
                    <Link href="/player"><button type="button" className="btn btn-outline-info" onClick={this.props.onCLick}>Mega</button></Link>
                    <Link href="/player"><button type="button" className="btn btn-outline-info" onClick={this.props.onCLick}>Star</button></Link>
                    <Link href="/player"><button type="button" className="btn btn-outline-info" onClick={this.props.onCLick}>Skai</button></Link>
                    <Link href="/player"><button type="button" className="btn btn-outline-info" onClick={this.props.onCLick}>Ert1</button></Link>
                    <Link href="/player"><button type="button" className="btn btn-outline-info" onClick={this.props.onCLick}>Ert2</button></Link>
                    <Link href="/player"><button type="button" className="btn btn-outline-info" onClick={this.props.onCLick}>Ert3</button></Link>
                </div>
                <hr className="hr"/>
            </Layout>
        )
    }
}
